import React from 'react';

const ServerError = () => {
    return (
    <div>
        <p>Sorry, the server is currently dealing with high traffic
        or is currently down. We suggest trying again in a few minutes or 
        contact us at test@gmail.com if the problem persists</p>
    </div>);
}


export default ServerError;
